"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Capacitive coupling in electrosurgery",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Capacitive coupling. Hybrid trocar sleeves are prone to induce capacitive coupling since the plastic locking anchor prevents the capacitive current from dissipating in the abdominal wall, resulting in electrical current passing through nearby structures such as bowel",
"    <div class=\"footnotes\">",
"    </div>",
