var title_f16_1_16403="Fire ant mound";
var content_f16_1_16403=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F57987&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F57987&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 519px\">",
"   <div class=\"ttl\">",
"    Fire ant mound",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 499px; height: 401px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The fire ant mound consists of a series of interlocking galleries, tunnels and chambers that extend downward into the ground. Galleries can extend anywhere from 1-3 feet into the soil, usually forming an inverted cone. Foraging tunnels just below the soil surface extend several yards out from the mound with periodic exits from which workers emerge to search for food on the soil surface.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Vinson SB, Sorensen, AA. Imported fire ants: Life history and impact. Texas Department of Agriculture 1986. Copyright &copy; 1986 Texas Department of Agriculture.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
