var title_f16_1_16410="Pemphigus foliaceus face";
var content_f16_1_16410=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F54341%7EDERM%2F60530%7EDERM%2F72419&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F54341%7EDERM%2F60530%7EDERM%2F72419&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pemphigus foliaceus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 350px; height: 374px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Pemphigus foliaceus lesions exhibit erythema, scaling, and crusting. The face and scalp are often the initial sites of involvement.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Stedman's Medical Dictionary. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pemphigus foliaceus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The scalp and periauricular lesions resemble those of seborrheic dermatitis in this patient with pemphigus foliaceus.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pemphigus foliaceus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 428px; height: 300px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Pemphigus foliaceus is characterized by erythema, scaling, and crusting that first appears on the face and scalp, and later involves the chest and back.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Bystryn J, Ruldolph J. Pemphigus. Lancet 2005; 266:61. Copyright &copy; 2005 Nicholas Soter, MD. Reproduced in Lancet with permission from: the New York University Department of Dermatology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
